import GloboEsporte from '../../components/GloboEsporte'
import GShow from '../../components/GShow'


const Noticias = () => {
  return (
    <ScrollView>
      <Button 
      title="Ir para About"
      onPress={() => navigation.navigate('About') }
    />
    <Container>
      {/* <ProductList
        // data={data}
